import React, { Component } from 'react';
import './App.css';
import ArticleTitles from './ArticleTitles'

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
         <ArticleTitles title="Cat"></ArticleTitles>
         <ArticleTitles title="Also Cat"></ArticleTitles>
        </header>
      </div>
    );
  }
}

export default App;
